let ProductsList = function ({children}) {
    let css = {
        display: "block",
        margin: "auto",
        width: "50%",
        border: "3px solid green",
        padding: "10px"
    }

    return (
        <products-list style={css}>
            {children}
        </products-list>
    )
};

export default ProductsList;
